import "./home.css";
import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <section>
            <div>
                <h1 className="heading">Intriguing hook will go here.</h1>
                <h2 className="under">An app that provides something that links <br/> with the intrigue mentioned above.</h2>
                <ul className="buttons">
                    <li><Link to="/signIn"><img className="button-item" src={require('./assets/layout/Preview.png')} alt=""></img></Link></li>
                    <li><Link to="/signUp"><img className="button-item" src={require('./assets/layout/App Store.png')} alt=""></img></Link></li>
                    <li><Link to="/emailLogin"><img className="button-item" src={require('./assets/layout/App Store.png')} alt=""></img></Link></li>
                </ul>
            </div>
            <div>
                <img className="fire" src={require('./assets/layout/Fire.png')} alt=""></img>
            </div>
            <div>
                <img className="phone-ex" src={require('./assets/layout/Phone Ex.png')} alt=""></img>
            </div>
            </section>
        )
    }
}

export default Home;
